export default function About() {
  return (
    <p className="bio">
      I am a software developer who completed General Assembly's Software
      Engineering Immersive in 2022. Whether launching a project or seeing it to
      completion, working with a team or independently, my skill-sets support
      quality outcomes with a drive to balance the technical with the creative.
      I also has a background as a working musician as well as a yoga and
      meditation teacher.
    </p>
  );
}
